    false,nt"url": null,nt"notes": "NCEI Accession 0144533 includes Surface
    underway data collected from LAURENCE M. GOULD in the North Pacific Ocean, South
    Atlantic Ocean, South Pacific Ocean and Southern Oceans (> 60 degrees South) from
    2008-12-31 to 2009-12-22. These data include BAROMETRIC PRESSURE, Partial pressure
    (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The
    instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
    and Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese
    data were collected by Taro Takahashi and Stewart Sutherland of Columbia University;
    Lamont-Doherty Earth Observatory and Colm Sweeney of University of Colorado at Boulder;
    Cooperative Institute for Research In Environmental Sciences as part of the VOS_LMG_Lines_2009
